def is_prime(num):
    if num < 2:
        return False
    for i in range(2, int(num ** 0.5) + 1):
        if num % i == 0:
            return False
    return True


def primes_list():
    count = 0
    num = 2
    while (count < 100):
        if is_prime(num):
            print(num)
            count += 1
        num += 1

